import styled from 'styled-components';

export const StyledPicture = styled.picture`
	flex-grow: 1;
	padding: 4px;
	img {
		width: 100%;
		float: left;
		height: 100%;
	}
`;

export const StyledGif = styled(StyledPicture)`
	display: ${props => props.useImage ? "none" : "block"};
`;
